@-moz-document domain("youtube.com") {
	.site-left-aligned #page.watch, .site-left-aligned #page.watch #guide, .site-left-aligned #page.watch #guide-container-collapsed, .site-left-aligned #page.watch #guide-container-expanded, .site-left-aligned #watch7-playlist, .site-left-aligned #watch7-video, .site-left-aligned #watch7-main,
	.site-left-aligned.guide-collapsed #watch7-playlist-container, .site-left-aligned.guide-collapsed #watch7-video-container, .site-left-aligned.guide-collapsed #watch7-main-container {
		background: Black !important}
	.guide-section-separator {
		border-color: #555 !important}
	#yt-hitchhiker-feedback {
		display: none !important}
	#page.watch #guide-container {
		background: rgba(251,251,251,.95) !important}
	#watch7-sidebar,
	.sidebar-collapsed #watch7-sidebar {
		background: #FBFBFB !important;
		max-width: 325px !important;
		padding-top: 15px !important;
		padding-right: 15px !important}
	#watch7-discussion {
		padding-top: 33px !important}
	#error-page {
		background: #1B1B1B !important}
	#error-page-content p {
		color: #CCC !important;
		text-shadow: 0 1px 1px Black !important}
	#error-page-content > #yt-masthead #logo {
		background: url("data:image/png;base64,") !important}
	#watch7-container #player {
		background: Transparent !important}
	div[id*="_wsRuleID"], #ad300x250, #watch-channel-brand-div, #watch-channel-brand-cap,
	.ad-div, a[href^="http://googleads.g.doubleclick.net/"], #google_companion_ad_div, #watch-longform-ad, #homepage-sidebar-ads, #premium-yva,
	div[id*="ad_creative_"], #instream_google_companion_ad_div {
		display:none !important}
/*	#player-branded-banner {
		background: linear-gradient(#1B1B1B, #777, #E6E6E6) !important} */
}
